import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
// import './Userhome.css';
import axios from 'axios';



const UserHomePage = () => {
  const [Policy, setPolicy] = useState([])

  // const navigate = useNavigate();

  useEffect(() => {
    axios.get('http://localhost:8080/user/policy')
      .then(response =>
        setPolicy(response?.data?.policies)
        // console.log(response?.data?.policies)
      )
      .catch(err => console.log(err))
  }, [])
  return (
    <div>
      <table className='table'>
        <thead>
          <tr>
            <th>
              PolicyId
            </th>
            <th>
              policy name
            </th>
            <th>
              premium Amount
            </th>
            <th>
              Coverage Amount
            </th>
          </tr>
          </thead>
          <tbody>
            {

              Policies.map(Policies=> {
                <tr key={Policies.policyId} >
                  <td>{Policies.policyId}</td>
                  <td>{Policies.name}</td>
                  <td>{Policies.premiumAmount}</td>
                  <td>{Policies.coverageAmount}</td>
                </tr>
              })
            }
          </tbody>
      </table>
    </div>

  );
};

export default UserHomePage;
